  [],\n\t\"revision_timestamp\": \"2016-07-27T22:42:18.579494\",\n\t\"name\": \"report-for-the-lake-erie-protection-fund-a-protein-biomarker-for-tumors-in-fish\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Neoplasm epizootics in fish populations
  are usually associated with xenobiotic contaminants in the aquatic environment.
  The objective of this research is to utilize an oncofetal protein to monitor the
  health of a fish population and thereby assess the quality of the environment. An
  ELISA assay would allow fish to be release after a blood sample was taken. It would
  also eliminate expensive histopathology, greatly eliminating not only the cost but
  also the time needed to analyze the data. Monitoring programs could have results
  within weeks and a report within months instead of the year(s) now often needed.
  The ongoing research is currently being funded by a USEPA grant. Resulting publications
  will be forwarded to LEPF offices.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
